import React from 'react';

import './Footer.css';

class Footer extends React.Component {

    render() {
        return (
            <footer className="footer">
                <div className="footer__footerWrapper">
                    <img src="/vector.png" alt="logo" className="footer__footerWrapper_cs-logo"></img>
                    <address className="footer__footerWrapper_footerTextBox">
                        <p className="footer__footerWrapper_footerTextBox_footerText">426057, Россия, Удмуртская Республика, г. Ижевск, ул. Карла Маркса, 246 (ДК «Металлург»)</p>
                        <p className="footer__footerWrapper_footerTextBox_footerText">
                            <a className="footer__footerWrapper_footerTextBox_footerText_tel" href="tel:+73412938861">+7 (3412) 93-88-61,</a> 
                            <a className="footer__footerWrapper_footerTextBox_footerText_tel" href="tel:+73412432929">43-29-29</a>
                        </p>
                        <a className="footer__footerWrapper_footerTextBox_hrefMainSite" href="https://htc-cs.ru/">htc-cs.ru</a>
                    </address>
                </div>
            </footer>
        )
    }
}

export default Footer;
